import Link from 'next/link';

const Nav = () => (
  <div id="navwrapper">
    <Link href="/">
      <a>J & M Transmission</a>
    </Link>
    <h2 id="hambutton">Ham</h2>
    <div id="linkwrapper">

      <ul id="dropdown">
        <li><Link href="/">
          <a>Contact Us</a>
        </Link></li>
        <li><Link href="/">
          <a>About</a>
        </Link></li>
      </ul>
    </div>

    <style jsx>{`
      #navwrapper {
        float: left;
        width: 100%;
        background: rgba(89, 89, 89, .8);
        margin: 0;
      }
      #linkwrapper {
        float: right;
      }
      a {
        float: left;
        padding: 22px;
        text-decoration: none;
        color: white;
        font: 18px 'Rubik';
        transition: all ease .4s;
      }
      a:hover {
        background: rgba(89,89,89,.4);
        color: #FF6161;
      }
      ul {
        float: left;
        display: block;
        margin: 0;
      }
      li {
        float: left;
        list-style: none;
        margin: 0;
      }
      h2 {
        float: right;
        display: none;
      }

/* This is the mobile version styling of the Navigation-Bar */

      @media only screen and (max-device-width: 480px) {
        #linkwrapper {
          position: relative;
          top: 1em;
          left: 0;
          width: 100%;
          z-index: 1000;
        }
        h2 {
          float: right;
          display: block;
          margin-right: 15px;
          color: white;
        }

        ul {
          float: left;
          width: 100%;
          display: block;
          z-index: 1000;
          margin: 0;
          background: white;
        }
        li a {
          color: black;
          width: 100%;
          margin: 0;
        }
        li {
          float: left;
          width: 100%;
          display: block;
          margin-left: 0;
          padding: 0;

        }
        #hambutton:click ~ #dropdown {
          display: block;
          float: left;
        }
      }
      `}</style>
  </div>
);

export default Nav;
